import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import { Search, Bell, Calendar, MapPin, Users, Plus, Sun, Moon, ArrowRight } from 'lucide-react';

const TeacherDashboard = ({ user, theme, toggleTheme, onLogout }) => {
  const navigate = useNavigate();
  const isDark = theme === 'dark';
  const [isMobile, setIsMobile] = useState(window.innerWidth < 768);

  useEffect(() => {
    const handleResize = () => setIsMobile(window.innerWidth < 768);
    window.addEventListener('resize', handleResize);
    return () => window.removeEventListener('resize', handleResize);
  }, []);

  // MOCK DATA (In real app, pass this as prop 'events')
  const myCreatedEvents = [
    { id: 1, title: "AI & Future Tech Workshop", date: "Apr 05, 2024", location: "Innovation Lab", category: "Tech", image: "https://images.unsplash.com/photo-1485827404703-89b55fcc595e?w=800&q=80", status: 'Active', registrations: 45 },
    { id: 2, title: "Web Dev Bootcamp", date: "Mar 20, 2024", location: "Comp Lab 2", category: "Coding", image: "https://images.unsplash.com/photo-1531482615713-2afd69097998?w=800&q=80", status: 'Completed', registrations: 120 },
    { id: 3, title: "Cyber Security Talk", date: "May 10, 2024", location: "Auditorium", category: "Seminar", image: "https://images.unsplash.com/photo-1550751827-4bd374c3f58b?w=800&q=80", status: 'Pending', registrations: 0 },
  ];

  const styles = {
    container: { padding: isMobile ? '4vw' : '2vw', backgroundColor: isDark ? '#0f172a' : '#f8fafc', minHeight: '100vh', fontFamily: "'Inter', sans-serif", margin: '0 auto' },
    header: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: '3vh', gap: isMobile ? '3vw' : '2vw' },
    profileSection: { display: 'flex', alignItems: 'center', gap: isMobile ? '3vw' : '1vw', cursor: 'pointer' },
    avatar: { width: isMobile ? '12vw' : '4vw', height: isMobile ? '12vw' : '4vw', borderRadius: '50%', border: '2px solid #4f46e5' },
    welcomeText: { display: 'flex', flexDirection: 'column' },
    hello: { fontSize: isMobile ? '3vw' : '0.9vw', color: '#64748b' },
    name: { fontSize: isMobile ? '4.5vw' : '1.2vw', fontWeight: '800', color: isDark ? '#fff' : '#1e293b' },
    createBtn: { backgroundColor: '#4f46e5', color: '#fff', padding: isMobile ? '1.5vh 4vw' : '1vh 1.5vw', borderRadius: '50px', border: 'none', fontWeight: 'bold', fontSize: isMobile ? '3.5vw' : '0.9vw', cursor: 'pointer', display: 'flex', alignItems: 'center', gap: '0.5vw' },
    heroBanner: { display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: isDark ? '#312e81' : '#e0e7ff', borderRadius: isMobile ? '4vw' : '1.5vw', padding: isMobile ? '5vw' : '3vw', marginBottom: '4vh', position: 'relative', overflow: 'hidden' },
    heroContent: { zIndex: 2 },
    heroTitle: { fontSize: isMobile ? '6vw' : '2.5vw', fontWeight: '800', marginBottom: '1vh', color: isDark ? '#fff' : '#1e1b4b' },
    heroText: { fontSize: isMobile ? '3.5vw' : '1.1vw', marginBottom: '2vh', color: isDark ? '#c7d2fe' : '#4338ca' },
    heroBtn: { backgroundColor: '#1e1b4b', color: '#fff', border: 'none', padding: isMobile ? '1.5vh 5vw' : '1vh 2vw', borderRadius: isMobile ? '2vw' : '0.8vw', fontWeight: 'bold', cursor: 'pointer' },
    grid: { display: 'grid', gridTemplateColumns: isMobile ? '1fr' : 'repeat(auto-fill, minmax(20vw, 1fr))', gap: isMobile ? '4vw' : '2vw' },
    eventCard: { backgroundColor: isDark ? '#1e293b' : '#fff', borderRadius: isMobile ? '3vw' : '1.2vw', overflow: 'hidden', border: isDark ? '1px solid #334155' : '1px solid #e2e8f0', cursor: 'pointer', display: 'flex', flexDirection: 'column' },
    cardImage: { width: '100%', height: isMobile ? '25vh' : '18vh', objectFit: 'cover' },
    cardBody: { padding: isMobile ? '4vw' : '1.5vw', flex: 1 },
    cardTitle: { fontSize: isMobile ? '4.5vw' : '1.2vw', fontWeight: 'bold', marginBottom: '1vh', color: isDark ? '#fff' : '#1e293b' }
  };

  return (
    <div style={styles.container}>
      {/* Header */}
      <div style={styles.header}>
        <div style={styles.profileSection} onClick={() => navigate('/profile')}>
          <img src={user.profileImage} alt="Profile" style={styles.avatar} />
          <div style={styles.welcomeText}>
            <span style={styles.hello}>Welcome,</span>
            <span style={styles.name}>{user.name}</span>
          </div>
        </div>
        <button style={styles.createBtn} onClick={() => navigate('/create-event')}>
           <Plus size={16} /> {isMobile ? "Add" : "Create Event"}
        </button>
      </div>

      {/* Hero Banner */}
      <div style={styles.heroBanner}>
        <div style={styles.heroContent}>
          <h1 style={styles.heroTitle}>Manage Your Events</h1>
          <p style={styles.heroText}>Create workshops, track registrations, and engage students.</p>
          <button style={styles.heroBtn} onClick={() => navigate('/create-event')}>+ New Event</button>
        </div>
      </div>

      {/* Events Grid */}
      <div style={{display:'flex', justifyContent:'space-between', marginBottom:'2vh'}}>
        <h2 style={styles.name}>My Events</h2>
        <span style={{color:'#6366f1', cursor:'pointer'}} onClick={() => navigate('/teacher-events')}>View All <ArrowRight size={16}/></span>
      </div>
      
      <div style={styles.grid}>
        {myCreatedEvents.map(event => (
          <div 
            key={event.id} 
            style={styles.eventCard} 
            // ✅ THIS IS THE FIX: Navigate to Teacher Event Details
            onClick={() => navigate(`/teacher-event-details/${event.id}`)}
          >
            <img src={event.image} alt={event.title} style={styles.cardImage} />
            <div style={styles.cardBody}>
              <h3 style={styles.cardTitle}>{event.title}</h3>
              <div style={{display:'flex', gap:'10px', color:'#64748b', fontSize:'0.9rem'}}>
                 <span><Calendar size={14}/> {event.date}</span>
                 <span style={{marginLeft:'auto', color: event.status==='Active'?'#16a34a':'#ca8a04'}}>{event.status}</span>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default TeacherDashboard;
